import { useEffect,useState } from "react"

const Profile = () => {

    const [token , setToken] = useState('')
    useEffect(() => {
        const token = localStorage.getItem('token')
        setToken(token)
    }, [])


  return (
    <div>
        <p>{token}</p>
        <p>hello</p>
    </div>
  )
}

export default Profile
